import React from 'react';
import Card from './Card';

const CardList = ({ hbcUsers }) => {
    return (
        <div className='flex justify-center flex-wrap'>
          {
            hbcUsers.map((user, i) => {
              return (
                <Card
                  email={hbcUsers[i].email}
                  id={hbcUsers[i].guid}
                  key={i}
                  motto={hbcUsers[i].motto}
                  name={hbcUsers[i].name.first + ' ' + hbcUsers[i].name.last}
                />
              )
            })
          }
        </div>
    );
}

export default CardList;
